import React from "react";
import Synth from "./Components/Synth";
import "./App.css";
import DataFetch from "./Components/DataFetch";
import DataSequence from "./Components/DataSequence";

function App() {
  return (
    <div className="App">
      <Synth />
      <DataFetch />
      <DataSequence />
    </div>
  );
}

export default App;
